progressIndicatorState=0
def progressIndicator():
    global progressIndicatorState
    progress = "|/-\\"
    progressIndicatorState += 1
    
    if (progressIndicatorState%128 == 0):
        sys.stdout.write( "\r{} {}".format(progress[(progressIndicatorState/128)%len(progress)],progressIndicatorState) ) #/100
        sys.stdout.flush()
    
def extractFalseAddresses(_logfile):
    state="search"  #"extract"
    
    addressesAsStrings = addressesToStrings(filterAdresses)
    ca = False
    addressIdx = 0
    falseErrorCode=False
    falseErrorCodeList = []
    
    
    for line in _logfile:
        #print(line, end="")
        progressIndicator()
        if state == "search":
            #ca, addressIdx = containsAddress(line, addressesAsStrings) 
            if "./xilsem_err_inj -p"+addressesAsStrings[addressIdx]+"\n" in line:
                state = "extract"
                addressIdx += 1
                if addressIdx >= len(addressesAsStrings): break
                    #return falseErrorCodeList 
                #print(line,end="")
                
        elif state == "extract":
            #print(line,end="")
             if "SH_MEM_ERR" in line:
                 falseErrorCode=True
             #ca, dummy = containsAddress(line, ["###########"])
             if "###########" in line:
                state = "search"
                if falseErrorCode:
                    falseErrorCode=False
                    falseErrorCodeList.append(addressIdx)
                #print(line,end="")
    return falseErrorCodeList


def substituteErrors(_infile, _outfile, _addresses):
    state = "copy" # "substitute"
    #substitute error with error code 224 MEMIF Error:
    #
    
    sub='''#
echo $?
224
# 
Return Code 224 indicated error. Logging to 2016-01-15/sort_perf_on_lvl3_run
Downloading Bitstream...
Downloading Kernel...
Waiting for system boot...
'''
    i=0
    lineCnt = 0
    lastLine = 0
    for line in _infile:
        
        # DEBUG
        if False and i > 200:
            print("")
            print("i: {}".format(i))
            print("Line: "+line)
            print("State: {}".format(state))
            print("Address: {}".format(_addresses[i]))
        
        lineCnt += 1
        if state == "substitute":
            if "FA " in line:
                state ="copy"
                
        if state == "copy":
            _outfile.write(line)
            # Space at end is important: it makes sure that 1,2,3,4 does match only 1,2,3,4 and not 1,2,3,45 too.
            if i < len(_addresses) and "FA "+_addresses[i]+" " in line:
            #if containsAddress(line, _addresses):
                _outfile.write(sub)
                state = "substitute" # skip lines until next "FA ..."
                i += 1
                #if i >= len(_addresses): break
                lastLine = lineCnt
    # DEBUG
    print("Last State: {}".format(state))
    print("Last Address: {}".format(_addresses[i-1]))
    print("Last Line: {}".format(lastLine))
    print("Linecount: {}".format(lineCnt))
    
    return i

def addressLessThan(a,b):
    for elA, elB in zip(a,b):
        if elA < elB: return True;
        elif elA > elB: return False;
    return False

